import React from "react";
import Header from "./components/Header";
import Footer from "./components/Footer";
import Notes from ".Notes";
import Note from ".Note";

function newNotes(noteDetail) {
  return <Note nTitle={noteDetail.title} nContent={noteDetail.content} />;
}

function App() {
  return (
    <div>
      <Header />
      {Notes.map(newNotes)}
      <Footer />
    </div>
  );
}
export default App;
